import React from 'react';

function ClienteGrid({ datosDelFormulario }) {
    // Utiliza los datos del formulario en tu tabla
    return (
        <table>
            <thead>
                <tr>
                    <th>Encabezado 1</th>
                    {/* Repite esto para los otros 19 encabezados */}
                </tr>
            </thead>
            <tbody>
                {datosDelFormulario.map((dato, index) => (
                    <tr key={index}>
                        <td>{dato.campo1}</td>
                        {/* Repite esto para los otros 19 campos */}
                    </tr>
                ))}
            </tbody>
        </table>
    );
}

export default ClienteGrid;
